class Solution{
public:
    int carFleet3(int target, vector<int>& position, vector<int>& speed){
        // This solution skips the sorting part so this is slightly faster as compared to others
        int numOfFleets = 0;
        float time1, time2;
        vector<int> vec;
        size_t size = position.size();
        vec.reserve(target); // Number of cars cannot be more than this
        // cout << "size : " << size <<endl;
        // cout << "capacity: " << vec.capacity() << endl;
        for (int i=0; i< size; i++){
            // vec[position[i]] = speed[i];
            vec[position[i]] = speed[i];
        }
        cout << "size : " << __LINE__ <<endl;
        size = vec.size();
        int count = 0;
        cout << "size : " << size <<endl;
        for(int pos=size-1; pos>0;)
        {
            if(count <5){
                count++;
                cout << __LINE__ << " " << pos << " " << vec[pos] << endl;
            }
            if(vec[pos] > 0){
                numOfFleets++ ;
                time1 = ((float)target-pos)/vec[pos];
                do{
                    pos--;
                    if (vec[pos] != 0){
                        time2 = ((float)target-pos)/vec[pos];
                    }else {
                        continue;
                    }
                }while(pos >= 0 && time2 <= time1);
                continue;
            }
            pos--;
        }
        return numOfFleets;
    
    }

    int carFleet2(int target, vector<int>& position, vector<int>& speed){
        // This solution skips the sorting part so this is slightly faster as compared to others
        int numOfFleets = 0;
        float time1, time2;
        vector<pair<int,int> > vec;
        int size = position.size();
        vec.reserve(target);
        //This is almost sorted except some zeroes. 
        for (int i=0; i< size; i++){
            vec[position[i]] = make_pair(position[i], speed[i]);
            if (i <5)
                cout << "first: " << vec[position[i]].first << "sec: " << vec[position[i]].second << endl;
        }
        cout << "size: " << size << endl;
        // return 0;
        for(int i=0; i<size;){
            if(i%1000 == 0)
            {
                cout << "i: " << i << endl;
            }
            if(vec[i].second != 0){
                numOfFleets++ ;
                time1 = ((float)target-vec[i].first)/vec[i].second;
                do{
                    i++;
                    if (vec[i].second != 0){
                        time2 = ((float)target-vec[i].first)/vec[i].second;
                    }else {
                        continue;
                    }
                }while(i<size && time2 <= time1);
            }
        }
    return numOfFleets;

    }

    int carFleet(int target, vector<int>& position, vector<int>& speed){
        // This solution first creates a vector pair, sort them and checks them.
        int numOfFleets = 0;
        float time;
        vector<pair<int,int> > vec;
        int size = position.size();
        for(int i=0; i<size; i++){
            vec.push_back(make_pair(position[i], speed[i]));
        }
        sort(vec.rbegin(), vec.rend());
        
        // for(int i=0; i< size; i++)
        // {
        //     numOfFleets += 1;
        //     time = ((float)target-vec[i].first)/vec[i].second;
        //     do{
        //         i++;
        //     }
        //     while(i<size && ((float)target-vec[i].first)/vec[i].second <= time);
        //     i--;
        // }

        int i=0;
        while(i<size){
            numOfFleets++ ;
            time = ((float)target-vec[i].first)/vec[i].second;
            do{
                i++;
            }while(i<size && ((float)target-vec[i].first)/vec[i].second <= time);
        }
        return numOfFleets;
    }
};

